import java.util.concurrent.atomic.AtomicInteger;

public class ResourcePoolRedistributionTest {

    // Simplified mock resource pool to simulate the behavior
    static class MockResourcePool {
        private final int maxTotalPerKey = 6;
        private final int maxTotal = 6;
        private final long maxWaitMillis = 5000;

        // Track borrowed resources per category
        private final AtomicInteger[] categoryCounts = new AtomicInteger[6];
        private final Object[] categoryLocks = new Object[6];

        public MockResourcePool() {
            for (int i = 0; i < categoryCounts.length; i++) {
                categoryCounts[i] = new AtomicInteger(0);
                categoryLocks[i] = new Object();
            }
        }

        public String borrowObject(String category) throws InterruptedException {
            int categoryIndex = getCategoryIndex(category);
            synchronized (categoryLocks[categoryIndex]) {
                if (categoryCounts[categoryIndex].get() >= maxTotalPerKey) {
                    // Simulate waiting
                    categoryLocks[categoryIndex].wait(maxWaitMillis);
                    if (categoryCounts[categoryIndex].get() >= maxTotalPerKey) {
                        throw new RuntimeException("Timeout waiting for resource");
                    }
                }
                categoryCounts[categoryIndex].incrementAndGet();
                return "resource_for_" + category;
            }
        }

        public void returnObject(String category, String resource) {
            int categoryIndex = getCategoryIndex(category);
            synchronized (categoryLocks[categoryIndex]) {
                categoryCounts[categoryIndex].decrementAndGet();
                categoryLocks[categoryIndex].notifyAll();
            }
        }

        public void clear(String category) {
            int categoryIndex = getCategoryIndex(category);
            synchronized (categoryLocks[categoryIndex]) {
                categoryCounts[categoryIndex].set(0);
                categoryLocks[categoryIndex].notifyAll();
            }
        }

        public int getNumActive(String category) {
            int categoryIndex = getCategoryIndex(category);
            return categoryCounts[categoryIndex].get();
        }

        public int getNumActive() {
            int total = 0;
            for (AtomicInteger count : categoryCounts) {
                total += count.get();
            }
            return total;
        }

        private int getCategoryIndex(String category) {
            switch (category) {
                case "category1": return 0;
                case "category2": return 1;
                case "category3": return 2;
                case "exhaust1": return 3;
                case "exhaust2": return 4;
                case "exhaust3": return 5;
                default: return 0;
            }
        }
    }

    @Test
    public void testCapacityRedistributionBasedOnLoadPriority() throws Exception {
        // Setup phase (steps 0-7)

        // Create the mock pool
        MockResourcePool pool = new MockResourcePool();

        // Steps 3-4: Establish six concurrent request threads with uneven load distribution
        CountDownLatch category1Latch = new CountDownLatch(1);
        CountDownLatch category2Latch = new CountDownLatch(2);
        CountDownLatch category3Latch = new CountDownLatch(3);

